// WARNING! If you want to edit this config file manually,
// please, read corresponding comments and be careful
// Import comments (0 - No; 1 - Yes)
comments=1
// Import labels (0 - No; 1 - Yes)
labels=1
// Check for collisions (0 - Overwrite silently; 1 - Skip if collision)
collisionchecks=1
//Apply names to (0 - Currently viewed module; 1 - Debuggee)
applytodebuggee=1
// Autoimport map if present (0 - Disabled; 1 - Ask to import; 2 - Import always)
autoimport=1
// Demangle names (0 - No; 1 - Yes)
demangle=0
// Filter names using masks (0 - No; 1 - Yes)
usemasks=0
// User specified masks (customfilter=n). The value n specifies
// the number of masks, next n lines are masks themselves.
// If the line is invalid it will be ignored
customfilter=0
